import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import axios from 'axios'
function Home() {

    const [books,setBooks]=useState([])

    useEffect(()=>{
        axios.get('http://localhost:9090/book/getAll').then(res=>{setBooks(res.data)}).catch(err=>{console.log(err)})
    },[])

  return (
    <div className='bg-dark text-light'>
        <div className='navbar bg-secondary'>
            <h3 className='navbar-brand text-dark ms-3'><b>Books Store</b></h3>
            <Link className='me-4 ms-auto btn btn-dark text-light'>Wishlist</Link>
            <Link className='btn btn-dark text-light me-4'>cart</Link>
        </div>
        <div className='inline-'>
            {
                books.map(data=>(
                    <>
                        <h3>{data.bookName}</h3>
                        <img src={data.bookImg} className='img'/>
                    </>
                ))
            }
        </div>
    </div>
  )
}

export default Home
